import React from 'react'

interface todos{
    tasks: string,
    setTasks: React.Dispatch<React.SetStateAction<string>>
}

const InputField : React.FC <todos> = ({tasks, setTasks}) => {
  return (
    <div>
      <form>
        <input onChange={(e) => setTasks(e.target.value)} type="text" placeholder="write your task" />
        <button>Go</button>
      </form>
    </div>
  )
}

export default InputField
